import './App.css';

function App() {
  return (
    <div className="App">
      <div className="App-rectangle">
        <h1>Hello, I'm Hannah.</h1>
        <div clasName="App-socials"></div>
      </div>
      <img src="src/images/IG_headshot.jpg" alt="my headshot"></img>

    </div>
  );
}

export default App;
